  false,\n\t\"url\": null,\n\t\"notes\": \"This grid represents habitat suitability
  based on the California Wildlife Habitat Relationships (CWHR) expert opinion habitat
  suitability rankings by habitat type. Habitat suitability rankings (ranging 0-100)
  for each combination of habitat type, size class (dbh) and cover class (density)
  were applied to the 30 m vegetation grid using CWHR's Bioview. These values were
  then averaged across grid cells to create a 270 m grid consistent with that used
  in the Maxent models for the project. The grid was then symbolized to represent
  low (0-50), medium (50-75) and high (75-100) habitat suitability. Models were reviewed
  by CDFW species experts; please review the use limitations.For more information
  see the project report at [https://nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=85358].\",\n\t\"owner_org\":
